contracts/FundMe.sol.content:
// Get funds from users
// withdraw funds
//set a min funding value

///SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.0; // version but not the latest(0.8.12)

import "./PriceConverter.sol";
contract FundMe {
    using PriceConverter for uint256;
    
    uint256 public minimumUsd = 50 * 1e18;// 1*10**18

     address[] public funders;// array for funders
     mapping(address => uint256) public addressToAmountFunded;

    function fund() public payable{
       // msg.value.getConversionRate();
        //set min.amount in USD
        //Sending Ethers to this Contract
        //funders sending ethers to our address
        require(msg.value.getConversionRate() > minimumUsd, "Didn't Send enough!");  // 18 decimals(wei)
        funders.push(msg.sender);
        addressToAmountFunded[msg.sender] = msg.value;
        

    }
}

contracts/PriceConverter.sol.content:
///SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.0;


import "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";

library PriceConverter {

     function getPrice() internal view returns(uint256) {
        //ABI
        //Address 0xD4a33860578De61DBAbDc8BFdb98FD742fA7028e
         AggregatorV3Interface priceFeed = AggregatorV3Interface(0xD4a33860578De61DBAbDc8BFdb98FD742fA7028e);
         (, int256 price, , , ) = priceFeed.latestRoundData(); //its int because it can be negative but not uint
         // ETH in USD 
         //3000.00000000
         return uint256 (price * 1e10);// 1**10 == 1000000000
         
    }

    function getVersion() internal view returns (uint256) {
        AggregatorV3Interface priceFeed = AggregatorV3Interface(0xD4a33860578De61DBAbDc8BFdb98FD742fA7028e);
        return priceFeed.version();
    }

    function getConversionRate(uint256 ethAmount) internal view returns (uint256) {
        //conversion rate will return it with 18 zeros(wei to ether exchange)
        uint256 ethPrice = getPrice();
        uint256 ethAmountInUsd = (ethPrice * ethAmount)/1e18;
        return ethAmountInUsd;
    }

}

